      SELECT DISTINCT + ( + col1 ) / + - col0 + - col2 * - col2 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col1 * + col1 <= ( - 72 );
  - name: tab0

outputs:
  - name: q6252.out
    data: |
      100
      2204
      9801
